import React from "react";

function Child(props) {
    console.log('render Child', props.count);
    return (
        <div>
            <h2>
                Child : {props.count}
            </h2>
            <h2>
                Name : {props.data.name}
            </h2>
            <button onClick={props.handleClick}>Inner Child</button>

        </div>
    )
}
export default React.memo(Child)
